class Problem {
    // Given a positive floating point number, it can be decomposed into
    // and integer part (largest integer smaller than given number) and decimals
    // (leftover part always smaller than 1).
    // Return the decimal part of the number.
    // >>> truncateNumber((3.5f))
    // (0.5f)
    public static float truncateNumber(float number) {
        // Getting the decimal part by subtracting the integer part from the number
        float decimalPart = number - (int)number;

        // If the decimal part is less than 1 (which can happen due to precision issues in floating point arithmetic),
        // we add 1 to the number and then subtract the integer part again to get the correct decimal part.
        if(decimalPart < 1) {
            number += 1;
            decimalPart = number - (int)number;
        }

        // Subtract the integer part from the decimal part to get the final result
        decimalPart -= (int)decimalPart;

        return decimalPart;

